import NavContext from '../components/NavContext';

function MyApp({ Component, pageProps }) {
    const [open, setOpen] = useState(false);

    return
    <NavContext.Provider value={{ open: open, setOpen: setOpen }} >
        <Component {...pageProps} />
    </NavContext.Provider>
}

